MongoDB Conditional Projection<p>I would like to conditonally leave out fields in a response.</p>

<p>I have an aggregation query which uses geoNear to find the nearest POI and I would like to only retreive all the information if the distance between the query point and the POI is less than 500.</p>

<p>Let's assume I want to leave out "someField" if the distance is less than or equal to 500.</p>

<p>Here is what I have come up with:</p>

<pre><code>db.pois.aggregate([
    { 
        "$geoNear": {
        "near": {
                type: "Point", 
                coordinates: [49.607857, 6.129143]
        }, 
        "maxDistance": 0.5 * 1000,
        "spherical": true,
        "distanceField": "distance"
        }
    }, {
        $project: {
            _id:0,
            "someField": {
                $cond: [{$lte: ["$distance", 500]}, 1, 0 ]
            }
        }
    } 
]).pretty()
</code></pre>

<p>But instead of leaving the field out of the response, this query somehow replaces the value of "distance" with 0 or 1.</p>

<p>I would appreciate any help.</p>

