Mongo MQL group by date and add counts of other field values<p>I'm struggling to understand how to query my data using MQL. My dataset looks a bit like this:</p>

<pre><code>{
    "_id": {
        "$oid": "5dcadda84d59f2e0b0d56974"
    },
    "object_kind": "pipeline",
    "object_attributes": {
        "status": "success",
        "created_at": "2019-11-12 16:28:22 UTC",
        "variables": []
    }
},
{
    "_id": {
        "$oid": "5dcadda84d59f2e0b0d56998"
    },
    "object_kind": "pipeline",
    "object_attributes": {
        "status": "failed",
        "created_at": "2019-11-13 12:22:22 UTC",
        "variables": []
    }
}
</code></pre>

<p>I'm adding <code>$eventDate</code> using this in my aggregation, which works:</p>

<pre><code>{
  eventDate: { $dateFromString: {
    dateString: {
      $substr: [ "$object_attributes.created_at",0, 10 ]
    }
  }},
}
</code></pre>

<p>And I'm trying to turn it into this:</p>

<pre><code>{
    "eventDate": "2019-11-12",
    "counts": {
        "success": 1,
        "failure": 0
    }
},
{
    "eventDate": "2019-11-13",
    "counts": {
        "success": 0,
        "failure": 1
    }
},
</code></pre>

<p>So far I can't seem to understand how to group the data twice, as if I group by "$eventDate" then I can't then group by status. Why can't I just group all docs from the same <code>$eventDate</code> into an array, without losing all the other fields?</p>

<p>It would be ideal if the <code>success</code> and <code>failure</code> fields which could be inferred from different statuses that appear in <code>object_attributes.status</code></p>

