    objectid:object._id
  });
};
</code></pre>

<p>GrabStuffFromDBToCalculate code (way simplified):</p>

<pre><code>module.exports = GrabStuffFromDBToCalculate = async collection =&gt; {
  const cursor = await collection
    .aggregate([

        // does a bunch of stuff here

    ])
    .toArray();
  const newObj = cursor[0];
  return newObj;
};
</code></pre>

