<pre><code>{
  "firstName": "Hulda",
  "lastName": "Lamb",
},
{
  "firstName": "Austin",
  "lastName": "Todd",
},
{
  "firstName": "John",
  "lastName": "Doe",
}
</code></pre>

<p>My goal is to obtain, let's say, the next person after Austin when the list is in alphabetical order. So I would like to get the person with firstName = Hulda.
We can assume that I know Austin's <code>_id</code>.
My first attempt was to rely on the fact that <code>_id</code> is incremental, but it won't work because the persons can be added in any order in the database. Hulda's <code>_id</code> field has a value less than Austin's. I cannot do something like <code>{_id: {$gt: &lt;Austin's _id here&gt;}};</code>
And I also need to limit the number of returned elements, so N is a dynamic value.</p>

<p>Here is the code I have now, but as I mentioned, the ID trick is not working.</p>

<pre><code>let cursor: any = this.db.collection(collectionName).find({_id: {$gt: 
cursor = cursor.sort({firstName: 1});
cursor = cursor.limit(limit);

return cursor.toArray();
</code></pre>

<p>Some clarifications:</p>

<ol>
