how to save document and update another which are dependent on each other with mongoose<p>Here is my bid model.</p>

<pre><code>const BidSchema = new Schema({
  auctionKey: {
    type: mongoose.Types.ObjectId,
    ref: "Auction",
    required: true
  },
  amount: { type: String, required: true },
  userName: { type: String, required: true },
});
</code></pre>

<p>And, here is my Auction Model (Notice the relationships between these two models).</p>

<pre><code>const AuctionSchema = new Schema({
  title: { type: String, required: true },
  startDate: { type: Date, required: true },
  closeDate: { type: Date, required: true },
  initialBidAmount: { type: Number, required: true },
  bidIncrementAmount: { type: Number, required: true },
  bids: [
    {
      type: mongoose.Types.ObjectId,
      ref: 'Bid'
    }
  ]
});
</code></pre>

<p>When user bids for any auction, I'm saving bid in bids collection and updating auctions collection using mongoose <code>findOneAndUpdate</code>.</p>

<pre><code>const postBid = async (req, res, next) =&gt; {
  const { auctionKey } = req.body;
  const bid = new BidModel(req.body);
  bid.save(error =&gt; {
    if (error) {
      res.status(500).json({ message: "Could not post bid." });
    }
  });

  const aucById = await AuctionModel.findOneAndUpdate(
    { _id: auctionKey },
    { $push: { bids: bid } }
  ).exec((error: any, auction: IAuction) =&gt; {
    if (error) {
      res.status(500).json({ message: "Could not post bid." });
    } else {
      res.status(201).json({ bid });
    }
  });
};
</code></pre>

<p>For any reason if any of these two (<code>save</code> bid and <code>findOneAndUpdate</code>) throws any error I want nothing to be saved into database. I mean to say either they should save and update or nothing should be done on database.</p>

<p>I have tried using mongoose session and transaction but got this error.</p>

<pre><code> MongoError: This MongoDB deployment does not support retryable writes. Please add retryWrites=false to your connection string.
</code></pre>

<p>Is there any way to work out in this scenario?</p>

